import React from 'react';
import './Home.css';

const Home = () => {
  return (
    <div className="home-container">
      <head>
        <link rel="icon" href="/images/Pixelate v5.png" />
        <title>Pixelate</title>
      </head>

      {/* 
        If you want to keep your video background, leave this section. 
        Otherwise, remove it or comment it out.
      */}
      <video className="video-background" autoPlay loop muted>
        <source src="/images/background-video.mp4" type="video/mp4" />
        Your browser does not support the video tag.
      </video>

      {/* Slogan Section */}
      <section className="slogan-section">
        <h1>Slogan</h1>
        <p>
          A brief statement that captures the essence of Pixelate or
          a short tagline describing your mission.
        </p>
        <button className="cta-button">Get Started</button>
      </section>

      {/* About Pixelate */}
      <section className="about-section">
        <h2>About Pixelate</h2>
        <p>
          Brief description about Pixelate. You can talk about your vision,
          mission, or what makes Pixelate unique in the market.
        </p>
        <div className="stats-container">
          <div className="stat-box">
            <h3>Stat</h3>
            <p>Short description</p>
          </div>
          <div className="stat-box">
            <h3>Stat</h3>
            <p>Short description</p>
          </div>
          <div className="stat-box">
            <h3>Stat</h3>
            <p>Short description</p>
          </div>
          <div className="stat-box">
            <h3>Stat</h3>
            <p>Short description</p>
          </div>
        </div>
      </section>

      {/* Our Services */}
      <section className="services-section">
        <h2>Our Services</h2>
        <div className="services-container">
          {/* Example service #1 */}
          <div className="service-box">
            <h3>Photo Lifting</h3>
            <p>
              Turn 2D images into 3D representations with cutting-edge
              machine vision and advanced modeling.
            </p>
            <p className="service-link">Learn More...</p>
          </div>
          {/* Example service #2 */}
          <div className="service-box">
            <h3>All in one hub for CAD</h3>
            <p>
              Collaborate on CAD projects in real-time, manage versions,
              and streamline your entire workflow.
            </p>
            <p className="service-link">Learn More...</p>
          </div>
        </div>
        {/* Service illustration */}
        <div className="services-image">
          <img src="/images/services-illustration.png" alt="Services" />
        </div>
      </section>

      {/* Contact Us */}
      <section className="contact-section">
        <h2>Contact Us</h2>
        <p>
          Have any questions or want to get in touch? Drop us a line at:
        </p>
        <p className="contact-info">contact@pixelate.com</p>
      </section>

      {/* Footer */}
      <footer className="footer-section">
        <p>Â© 2023 Pixelate. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default Home;
